properties.script:
[
    {"type":"narrate", "data":[
	["<i>(sound of parent)</i>", ["<%parent_greeting%>", "<%partner_greeting%>"]],
	["<%name%> heard a familiar sound and headed downstairs.", ["<%name%>", "/s/assets/narration/heardafamiliar.mp3"]]
]}
]

[
    {"type":"narrate", "data":[
	["In the playroom were two of <%name%>'s best friends: <%friend1_name%> and <%friend2_name%>", ["/s/assets/narration/intheplayroom.mp3", "<%name%>", "/s/assets/narration/bestfriends.mp3", "<%friend1_name%>", "/s/assets/narration/and.mp3", "<%friend2_name%>"]]
]}
]

[
    {"type":"narrate", "data":[
	["As <%name%> entered the kitchen, they were greeted by their parents.", ["/s/assets/narration/as.mp3", "<%name%>", "/s/assets/narration/enteredthekitchen.mp3"]],
	["<i>(parents' greetings)</i>", ["<%parent_greeting%>", "<%partner_greeting%>"]]
]}
]

[
    {"type":"narrate", "data":[
	["As time passed, <%name%> grew and soon they didn't need walking to school. They were grown up.", ["/s/assets/narration/astimepassed.mp3", "<%name%>", "/s/assets/narration/grewandsoon.mp3"]],
	["<%name%>'s parents were upset of course", ["<%name%>", "/s/assets/narration/parentswereupset.mp3"]],
	["<i>crying</i>", ["<%parent_cry%>", "<%partner_cry%>"]]
]}
]

[
    {"type":"narrate", "data":[
	["Like always, there was a message left on the board when <%name%> entered.", ["/s/assets/narration/likealways.mp3", "<%name%>", "/s/assets/narration/entered.mp3"]]]
}
]

[
{"type":"narrate", "data":[
    ["And like always, <%name%> left their own message for whoever would enter next.", ["/s/assets/narration/andlikealways.mp3", "<%name%>", "/s/assets/narration/lefttheirown.mp3"]]]
},
    {"type": "image", "key": "blackboard", "title": "Blackboard message", "instruction": "Leave a message on the blackboard", "width": 64, "height": 64, "background": "#1e1e1e"},
    {"type": "modifyTilesheet", "data": [
                        ["/s/assets/blackboard-empty.png", 7, 21],
	["<#blackboard#>", 7, 21]
                    ]}
]

[
    {"type":"narrate", "data":[
	["This is an important part, the school dance. This is where it all happens.", ["/s/assets/narration/thisisan.mp3"]],
	["But that's not right. <%name%> hated that haircut. I'm sure they changed it right before the dance.", ["/s/assets/narration/butthatsnot.mp3", "<%name%>", "/s/assets/narration/hatedthathaircut.mp3"]]
]},
    {"type": "image", "key": "hair", "title": "Haircut", "instruction": "Finally <%name%> gets to choose their own hair style. Give them something cool.", "width": 55, "height": 42, "guide": "/s/assets/guides/hair-guide.png"},
    {"type": "useOwnHair"},
{"type":"narrate", "data":[
	["That's more like it. <%name%> continued into the sports hall.", ["/s/assets/narration/thatsmorelikeit.mp3", "<%name%>", "/s/assets/narration/continuedinto.mp3"]]
]}
]

[
    {"type":"narrate", "data":[
	["And it was there, between the basketball hoops, that <%name%> met their soulmate.", ["/s/assets/narration/anditwasthere.mp3", "<%name%>", "/s/assets/narration/mettheirsoulmate.mp3"]],
	["As the music stopped, and the track changed to something unforgettable, their eyes met.", ["/s/assets/narration/asthemusicstopped.mp3"]],
	["<i>Unforgettable music</i>", ["<%music%>"]],
	["And then, they touched.", ["/s/assets/narration/andthen.mp3"]]
]},
    {"type": "findPartner"}
]

[
    {"type":"narrate", "data":[
	["The first kiss.", ["/s/assets/narration/thefirstkiss.mp3"]],
	["This was a moment <%name%> had thought about for a long time.", ["/s/assets/narration/thiswasamoment.mp3", "<%name%>", "/s/assets/narration/hadthoughtabout.mp3"]],
	["They had prepared, and this was going to be perfect. It wouldn't be too long or short, too fast or slow, not too loud, but not too quiet.", ["/s/assets/narration/theyhadprepared.mp3"]]
]},
    {"type":"audio", "key": "kiss", "title": "Kiss", "instruction": "Make a kissing sound"},
    {"type":"prepareKiss"}
]

[
    {"type":"narrate", "data":[
	["They spent a lot of time together over the following months.", ["/s/assets/narration/theyspentalot.mp3"]],
	["Getting to know each other's likes and dislikes", ["/s/assets/narration/gettingtoknow.mp3"]],
	["Holding hands, hugging, and eventually...", ["/s/assets/narration/holdinghands.mp3"]]
]},
    {"type": "changeOutOfSchoolClothes"}
]

[
    {"type":"narrate", "data":[
	["<%name%> and <#partner_name#> grew together. Never spending much time apart.", ["<%name%>", "/s/assets/narration/and.mp3", "<#partner_name#>", "/s/assets/narration/grewtogether.mp3"]],
	["They shared many more kisses.", ["/s/assets/narration/theysharedmany.mp3"]]
]},
    {"type":"growUp"}
]

[
    {
        "type":"narrate", "data":[
            [
                "And eventually, <%name%> and <#partner_name#> started a family.", ["/s/assets/narration/andeventually.mp3", "<%name%>", "/s/assets/narration/and.mp3", "<#partner_name#>", "/s/assets/narration/startedafamily.mp3"]]
            ]
    },
    {"type":"text", "key": "name", "title": "Baby Name", "instruction": "What is the baby's name?"},
    {"type":"audio", "key": "name", "title": "<#name#>", "instruction": "How do you pronounce <#name#>?"},
    {"type":"narrate", "data":[
        ["Little <#name#> was the joy of their lives.", ["/s/assets/narration/little.mp3", "<#name#>", "/s/assets/narration/wasthejoy.mp3"]],
        ["They provided clothing.", ["/s/assets/narration/theyprovided.mp3"]]
    ]},
    {"type":"colour", "key": "clothes_color", "title": "Clothing Colour", "instruction": "What colour is <#name#>'s clothes?"},
    {"type": "refreshChild"},
    {"type":"narrate", "data":[
        ["housing.", ["/s/assets/narration/housing.mp3"]]
    ]},
    {"type":"image", "key": "wallpaper", "title": "Wallpaper", "instruction": "How should <#name#>'s wallaper look?", "width": 64, "height": 64, "background": "#FFFFFF", "tiled": true},
    {"type": "modifyTilesheet", "data": [
                        ["/s/assets/wallpaper-empty.png", 0, 3],
	["<#wallpaper#>", 0, 3]
                    ]},
    {"type":"narrate", "data":[
        ["And of course love.", ["/s/assets/narration/andofcourselove.mp3"]]
    ]},
    {"type":"audio", "key": "song", "title": "Song", "instruction": "Sing or hum a 10 second song for <#name#>."},
    {"type":"narrate", "data":[
        ["Life couldn't be happier for <%name%>, <#partner_name#>, and <#name#>", ["/s/assets/narration/lifecouldntbe.mp3", "<%name%>", "<#partner_name#>", "<#name#>"]]
    ]}
]

[
    {
        "type":"narrate", "data":[
            [
                "<%name%> and <#partner_name#> would both insist on walking <#name#> to school.", ["<%name%>", "/s/assets/narration/and.mp3", "<#partner_name#>", "/s/assets/narration/wouldbothinsist.mp3", "<#name#>", "/s/assets/narration/toschool.mp3"]]
            ]
    }
]

[
    {
        "type":"narrate", "data":[
            [
                "content that <#name#> was settled, <%name%> and <#partner_name#> continued onwards together", ["/s/assets/narration/contentthat.mp3", "<#name#>", "/s/assets/narration/wassettled.mp3", "<%name%>", "/s/assets/narration/and.mp3", "<#partner_name#>", "/s/assets/narration/continuedonwards.mp3"]]
            ]
    }
]

[
    {
        "type":"narrate", "data":[
            [
                "<%name%> and <#partner_name#> grew old together, very proud of <#name#>'s progress.", ["<%name%>", "/s/assets/narration/and.mp3", "<#partner_name#>", "/s/assets/narration/grewold.mp3", "<#name#>", "/s/assets/narration/progress.mp3"]]
            ]
    },
    { "type": "growOld"}
]

[
    {
        "type":"narrate", "data":[
            [
                "They saw their friends passing.", ["/s/assets/narration/theysawtheir.mp3"]]
            ]
    }
]

[
    {
        "type":"narrate", "data":[
            [
                "First <%friend1_name%>.", ["/s/assets/narration/first.mp3", "<%friend1_name%>"]]
            ]
    }
]

[
    {
        "type":"narrate", "data":[
            [
                "Then <%friend2_name%>.", ["/s/assets/narration/then.mp3", "<%friend2_name%>"]]
            ]
    }
]

[
{
    "type": "partnerDie"
},
    {
        "type":"narrate", "data":[
                ["Eventually, It was <%partner_name%>'s time.", ["/s/assets/narration/eventually.mp3", "<%partner_name%>", "/s/assets/narration/time.mp3"]],
                ["<%name%> was heartbroken..", ["<%name%>", "/s/assets/narration/washeartbroken.mp3"]],
                ["<i>Cry</i>", ["<#cry#>"]],
                ["They carried on alone", ["/s/assets/narration/theycarriedon.mp3"]]
            ]
    }
]

[
{
    "type": "die"
},
    {
        "type":"narrate", "data":[
            ["But this heartbreak didn't last long", ["/s/assets/narration/butthis.mp3"]],
            ["As <%name%> passed away themselves shortly afterwards.", ["/s/assets/narration/as.mp3", "<%name%>", "/s/assets/narration/passedaway.mp3"]]
         ]
    },
{"type": "image", "key": "gravestone", "title": "Gravestone", "instruction": "Draw <%name%>'s gravestone.", "width": 64, "height": 64, "guide": "/s/assets/guides/gravestone-guide.png"},
{
    "type": "endGame"
}
]

[
    {
        "type":"narrate", "data":[
            [
                "But one day, <#name#> would get too old, and would want to walk by themselves.", ["/s/assets/narration/butoneday.mp3", "<#name#>", "/s/assets/narration/wouldgettooold.mp3"]]
            ]
    },
    {
        "type": "childRunAway"
    }
]
